import React from 'react';
import './PersonalInfo.css';

function PersonalInfo() {
    return (
        <div className="PersonalInfo">
            <h2>About Me</h2>
            <p>I am Jerry Liu, a third-year student at the University of Chicago, majoring in Computer Science, Math, and Statistics. I have a passion for software development, data science, artificial intelligence, and research. My goal is to become a skilled tech professional and contribute to the tech community in any way possible.</p>
        </div>
    );
}

export default PersonalInfo;
